import "./Teacher.css";
import Submenubar from "../../Components/Submenubar";
import { Outlet } from "react-router-dom";

function Teacher() {
  const submenus = [
    ["레슨안내", "/Teacher/Teacher_info"],
    ["샘플레슨 신청", "/Teacher/sample_Teacher"],
  ];
  return (
    <>
      <Submenubar submenus={submenus} />
      <Outlet />
    </>
  );
}

export default Teacher;
